,p_process_type=>'NATIVE_PLSQL'
,p_process_name=>'SEND_REMINDER_PROCESS'
,p_process_sql_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'BEGIN',
'  FOR rec IN (',
'    SELECT bi.Issue_Date,',
'           bi.Return_Date,',
'           bi.BOOK_ID,',
'           m.Email_Id,',
'           m.Name',
'    FROM ISSUE bi',
'    JOIN MEMBER m ON bi.MEMBER_ID = m.MEMBER_ID',
'    WHERE bi.Return_Date <= TRUNC(SYSDATE + 1)',
'      AND bi.REMINDER_SENT = ''NO''',
'  ) LOOP',
'',
'    ',
'    APEX_MAIL.SEND(',
'      p_to    => rec.Email_Id,',
'      p_from  => ''library@yourdomain.com'', ',
unistr('      p_subj  => ''\D83D\DCDA Book Return Reminder'','),
'      p_body  => ''Dear '' || rec.Name || '','' || CHR(10) ||',
'                 ''This is a kind reminder that your borrowed book (Book ID: '' || rec.BOOK_ID || '') is due on '' ||',
'                 TO_CHAR(rec.Return_Date, ''DD-MON-YYYY'') || ''.'' || CHR(10) ||',
'                 ''Please return it on time to avoid fines.'' || CHR(10) ||',
'                 ''Thank you!'' || CHR(10) ||',
'                 ''- Library Team''',
'    );',
'',
'   ',
'    UPDATE ISSUE',
'    SET REMINDER_SENT = ''YES''',
'    WHERE Issue_Date = rec.Issue_Date;',
'',
'  END LOOP;',
'',
'  COMMIT;',
'END;',
''))
,p_process_clob_language=>'PLSQL'
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
,p_process_success_message=>'Email Reminder Sent Successfully'
,p_internal_uid=>44709685854940507407
);
end;
